import React from 'react';
import { Link } from 'react-router-dom';
import { FiArrowLeft} from 'react-icons/fi';//eu acho o FiArrowLeft procurando em feather icons
import './style.css';
import logoImg from '../../assets/logo.svg';

export default  function Register(){
    return (
        <div className="register-container">
            <div className="content">
                <section>
                    <img src={logoImg} alt="Be the hero"/>
                    <h1>Cadastro</h1>
                    <p>Faça seu cadastro, entre na plataforma e ajude pessoas a encontrarem os casos da sua ONG.</p>

                    <Link className="back-link" to="/register">
                        <FiArrowLeft size={16} color="#E02041" />
                    Não tenho cadastro</Link>
                </section>

                <form>
                    <input placeholder="Nome da ONG" />
                    <input type="email" placeholde="E-mail" />
                    <input placeholder="whatsapp" />
                    <div className="input-group">{/* Crio uma div pra ficar um do lado do outro */}
                        <input placeHolder="Cidade"/>
                        <input placeholder="UF" style={{width: 80}}/>{/**deixo com largura fixa, estou incluindo um codigo css usando essas {{}} */}
                    </div>
                    <button className="button" type="submit">Cadastrar</button> 
                </form>
            </div>
        </div>
    );
}
